import Header from "../../components/Header";
import Footer from "../../components/Footer";
import Menu from "../../components/Menu";

const Home = () => {
  const [name, setName] = useState();

  return (
    <div className="background">
      <Header user={name} />
      <Menu user={name} setName={setName} />
      <Footer />
    </div>
  );
};

export default Home;
